import './Profile.css';

const Profile = () => {
  return (
    <div className="profile">
      <div className="profile-header">
        <img className="profile-picture" src="https://via.placeholder.com/150" alt="Profile" />
        <h2>Username</h2>
        <p>Bio: This is the user bio.</p>
      </div>
      <div className="profile-feed">
        {/* Here you can add components or elements to display user posts */}
        <div className="tweet">User's tweet or post 1</div>
        <div className="tweet">User's tweet or post 2</div>
        {/* Add more tweets or posts as needed */}
      </div>
    </div>
  );
};

export default Profile;
